// Place your application-specific JavaScript functions and classes here
// This file is automatically included by javascript_include_tag :defaults

$(function() {
  require('./views/search');
  require('./views/trips/index');
  require('./views/trips/quick');
  require('./views/reservations/pending');
  require('./views/reservations/confirmed');
  require('./views/reservations/unconfirmed');
  require('./views/reservations/unpaid');
  require('./views/calendar/entries');
});


$(function () {
  var lib = require('./lib');

  function toggleWithCheckbox(target, source, focus) {
    if ($(source).is(':checked')) {
      var $target = $(target).show();
      if (focus) $target.find('input').focus();
    }
    else {
      $(target).hide();
    }
  }

  $('#reservation_confirmed').on('change', function(ev, skipFocus) {
    toggleWithCheckbox('#toggle_confirm', this, !skipFocus)
  }).triggerHandler('change', true);

  $('#reservation_paid').on('change', function(ev, skipFocus) {
    toggleWithCheckbox('#toggle_paid', this, !skipFocus)
  }).triggerHandler('change', true);

  setTimeout(function() {
    $('#flash-notice').fadeOut();
  }, 5000);
});

module.exports = {
  Search: require('./search'),
  Forms: require('./forms'),
  Reservations: require('./reservations'),
  Trips: require('./trips')
};

var lib = {
  formInputs: function formInputs(form) {
    var $form = $(form);

    var types = [':button',':reset',':submit',':disabled','[type="hidden"]'],
        selector = types.map(function(s) { return ':not(' + s + ')' }).join('');

    return $form.find(':input' + selector);
  },

  guessInput: function guessInput(inputs) {
    var $inputs = $(inputs)
        .filter(function() { return this.value === '' });

    if ($inputs.length === 0) {
      $inputs = $inputs.end();
    }

    return $inputs.first();
  },

  selectInput: function selectInput(input) {
    var $input = $(input);

    if ($input.val() === '') {
      $input.focus();
    }
    else {
      $input.select();
    }
  },

  selectFormInput: function selectFormInput(form) {
    var inputs = lib.formInputs(form),
        first = lib.guessInput(inputs);

    lib.selectInput(first);
  }
};


module.exports = lib;

var React = require('react');
var ReactDOM = require('react-dom');
var components = require('components');
var lib = require('../lib');

var $searchClients = $('#search-clients'),
    $searchModal = $('#search-modal'),
    $searchMount = $searchModal.find('.react-mount'),
    searchUrl = $searchClients.attr('href');

$searchClients.on('click', function(ev) {
  ev.preventDefault();

  ReactDOM.render(
      React.createElement(components.Search, {url: searchUrl}),
      $searchMount.get(0),
      function() { $searchModal.modal('show') }
  );
});

$searchModal.on('shown.bs.modal', function() {
  lib.selectFormInput($searchModal);
});

var _ = require('lodash');
var React = require('react');

var Search = React.createClass({
  getInitialState: function() {
    return {query: '', results: [], loading: false}
  },

  handleQueryChange: function(ev) {
    var sanitized = String(ev.target.value).trim();

    if (sanitized) {
      this.setState({query: sanitized, loading: true});
      this.performSearch();
    }

    else {
      this.setState(this.getInitialState());
    }
  },

  performSearch: _.debounce(function performSearch() {
    $.ajax({
      url: this.props.url,
      data: {q: this.state.query},
      success: function(results) {
        if (this.isMounted()) {
          this.setState({loading: false, results: results});
        }

      }.bind(this)
    })
  }, 250),

  render: function() {
    var content = (
        <SearchResults data={this.state.results}
                       loading={this.state.loading} />
    );

    return (
        <form action={this.props.url}
              onSubmit={function(e) { e.preventDefault() }}>

          <div className="form-group">
            <label htmlFor="search-query" className="sr-only">Search</label>
            <input type="search" name="q"
                   value={this.state.query}
                   onChange={this.handleQueryChange}
                   id="search-query"
                   className="form-control"
                   autoComplete="off"
                   placeholder="name, email, or phone" />

          </div>
          {this.state.query.length ? content : ''}
        </form>
    )
  }
});

var SearchResults = React.createClass({
  render: function () {
    if (this.props.loading) {
      return <SearchLoading />
    }

    else if (this.props.data.length) {
      var content = _.map(this.props.data, function (result, index) {
        return <SearchResult key={index}
                             url={result.url}
                             name={result.name}
                             phone={result.phone}
                             email={result.email} />

      });


      return (
          <table className="table table-striped">
            <tbody>
              {content}
            </tbody>
          </table>
      )
    }

    else {
      return <SearchNoResults />
    }
  }
});

var SearchResult = React.createClass({
  render: function () {
    var email, emailData, phone, phoneData

    if (this.props.email) {
      emailData = String(this.props.email)
          .toLowerCase()
          .trim()
          .replace(/^\W*|\W*$/, '');

      email = (
        <span>
          <i className="glyphicon glyphicon-envelope"/>
          &nbsp;
          <a href={"mailto:" + emailData}>
            {emailData}
          </a>
        </span>
      )
    }

    if (this.props.phone) {
      phoneData = String(this.props.phone).trim().replace(/\D/g, '');

      phone = (
        <span>
          <i className="glyphicon glyphicon-phone"/>
          &nbsp;
          <a href={"tel:" + phoneData}>
            {this.props.phone}
          </a>
        </span>
      )
    }

    return (
        <tr>
          <td className="col-xs-6">
            <i className="glyphicon glyphicon-user" />
            &nbsp;
            <a href={this.props.url}>
              {this.props.name}
            </a>
          </td>

          <td className="col-xs-3 force-wrap">
            {email}
          </td>

          <td className="col-xs-3">
            {phone}
          </td>
        </tr>
    )
  }
});

var SearchNoResults = React.createClass({
  render: function() {
    return (
        <div className="alert alert-danger">
          <strong>
            <i className="glyphicon glyphicon-remove" />
            &nbsp; No results
          </strong>

          &nbsp; Sorry, nothing was found matching your search criteria.
        </div>
    )
  }
});

var SearchLoading = React.createClass({
  render: function() {
    return (
        <div className="alert alert-info">
          <strong>
            <i className="glyphicon glyphicon-refresh spin"/>
            &nbsp; Loading...
          </strong>

          &nbsp; Please wait while we query the server.
        </div>
    )
  }
});


module.exports = Search;

var React = require('react');
var _ = require('lodash');
var moment = require('moment');
var chrono = require('chrono-node');
var DatePicker = require('react-date-picker');

var lib = require('../lib');

function onKeyDown(ev) {
  ev.persist();

  if (ev.key === 'Enter') {
    var $target = $(ev.target),
        $form = $target.closest('form'),
        $inputs = lib.formInputs($form),
        index = $inputs.index($target),
        hasModifier = ev.ctrlKey || ev.metaKey;

    // pressing enter within a textarea should act normally,
    // unless pressing a modifier key also
    if (! hasModifier && $target.prop('tagName') === 'TEXTAREA') {
      return;
    }

    ev.preventDefault();

    if (index === $inputs.length - 1 || hasModifier) {
      var submit = $form.find('[type=submit]');
      if (submit.length) submit.first().click();
      else $form.submit();
    }
    else {
      $inputs.eq(index + 1).focus();
    }
  }
}

var StaticField = React.createClass({
  displayName: 'StaticField',

  render: function() {
    return (
        <div className="form-group">
          <label className="control-label">{this.props.title}</label>
          <p className="form-control-static">{this.props.value}</p>
        </div>
    )
  }
});

var TextField = React.createClass({
  displayName: 'TextField',

  render: function() {
    return (
      <div className="form-group">
        <label htmlFor={this.props.id}>
          {this.props.title}
        </label>

        <input type="text" className='form-control'
               onKeyDown={onKeyDown}
               required={Boolean(this.props.required)}
               defaultValue={this.props.defaultValue}
               valueLink={this.props.value}
               name={this.props.name}
               id={this.props.id} />
      </div>
    )
  }
});

var TextArea = React.createClass({
  displayName: 'TextArea',

  render: function() {
    return (
        <div className="form-group">
          <label htmlFor={this.props.id}>
            {this.props.title}
          </label>

          <textarea className='form-control'
                 onKeyDown={onKeyDown}
                 required={Boolean(this.props.required)}
                 defaultValue={this.props.defaultValue}
                 valueLink={this.props.value}
                 name={this.props.name}
                 id={this.props.id} />
        </div>
    )
  }
});

var NumberField = React.createClass({
  displayName: 'NumberField',

  render: function() {
    var range = _.pick(this.props, ['min', 'max', 'step']);

    return (
      <div className="form-group">
        <label htmlFor={this.props.id}>
          {this.props.title}
        </label>

        <input type="number" className='form-control'
               onKeyDown={onKeyDown}
               placeholder={this.props.title}
               required={Boolean(this.props.required)}
               defaultValue={this.props.defaultValue}
               valueLink={this.props.value} {...range}
               name={this.props.name}
               id={this.props.id} />
      </div>
    );
  }
});

var SelectField = React.createClass({
  displayName: 'SelectField',

  render: function() {
    var options = _(this.props.options).map(function (o) {
      if (typeof o !== 'object') {
        return {value: o, title: String(o)}
      }
      else if (Array.isArray(o)) {
        return {value: o[0], title: (o[1] || o[0])}
      }
      else {
        return o;
      }
    }).map(function (opt) {
      return (
        <option key={opt.value} value={opt.value}>{opt.title}</option>
      );
    }).value();

    if (this.props.prompt) {
      options.unshift(
        <option key="prompt">{this.props.prompt}</option>
      );
    }

    return (
      <div className="form-group">
        <label htmlFor={this.props.id}>
          {this.props.title}
        </label>

        <select className="form-control"
                onKeyDown={onKeyDown}
                valueLink={this.props.value}
                id={this.props.id} 
                name={this.props.name}>
          {options}
        </select>
      </div>
    )
  }
});

var PaxField = React.createClass({
  displayName: 'PaxField',
  statics: {
    ValidationRegExp: /^\d+(?:\/\d+){0,2}/,

    parsePax: function(value) {
      var parts = String(value).split('/').map(parseInt);

      return {
        total: (parts[0] || 0),
        children: (parts[1] || 0), 
        disabled: (parts[2] || 0)
      };
    },

    reformat: function(value) {
      var pax = this.parsePax(value);
      var output = String(pax.total);

      if (pax.children) {
        output += '/' + pax.children;
      }

      if (pax.disabled) {
        if (! pax.children) output += '/0';
        output += '/' + pax.disabled;
      }

      return output;
    },
  },

  render: function() {
    var events = _.pick(this.props, 'onBlur onFocus onChange'.split(' '));

    return (
      <div className="form-group">
        <label htmlFor={this.props.id}>
          {this.props.title}
        </label>

        <div className="input-group">
          <div className="input-group-addon">
            <i className="glyphicon glyphicon-user" />
          </div>

          <input type="text" className="form-control" {...events}
                 onKeyDown={onKeyDown}
                 placeholder="number of people"
                 required={Boolean(this.props.required)}
                 valueLink={this.props.value}
                 name={this.props.name}
                 id={this.props.id} />

        </div>
      </div>
    );
  }
});

var DateTimeField = React.createClass({
  displayName: 'DateTimeField',

  handleShowPicker: function(ev) {
    ev.preventDefault();

    var valid = this.validateValue(),
        date = moment(this.parseValue());

    this.setState({open: ! this.state.open, date: date, valid: valid});
  },

  handlePickDate: function(_, selected) {
    var prev = this.state.date;
    var dateTime = moment(selected)
        .hour(prev.hour())
        .minute(prev.minute())
        .second(prev.second());

    var format = this.props.noTime ? 'YYYY-MM-DD' : 'YYYY-MM-DD h:mm A';

    var formatted = dateTime.format(format);
    this.props.value.requestChange(formatted);

    this.setState({date: dateTime, valid: true});

    this.hidePicker();
  },

  hidePicker: function() {
    this.setState({open: false});
  },

  validateValue: function() {
    if (! this.props.value.value) return true;

    var dt = this.parseValue();
    return moment(dt).isValid();
  },

  parseValue: function() {
    var string = this.props.value.value;

    if (! string) return moment();

    return moment.utc(chrono.parseDate(string));
  },

  getInitialState: function() {
    var value = this.parseValue(),
        valid = this.validateValue(),
        initialDate = valid ? moment(value) : moment().startOf('day');

    return {open: false, valid: valid, date: initialDate};
  },

  render: function() {
    var events = _.pick(this.props, 'onBlur onFocus onChange'.split(' '));
    var classes = 'form-group datetime-container';
    var picker;

    var placeholder = 'date and time';
    if (this.props.noTime) placeholder = 'date';

    if (! this.state.valid) classes += ' has-error';

    if (this.state.open) {
      picker = React.createElement(DatePicker, {
        minDate: this.props.min,
        maxDate: this.props.max,
        date: this.state.date,
        onChange: this.handlePickDate,
        hideFooter: true
      });
    }

    return (
      <div className={classes}>
        <label htmlFor={this.props.id}>
          {this.props.title}
        </label>

        <div className="input-group">

          <input type="datetime"
                 className="form-control" {...events}
                 placeholder={placeholder}
                 onKeyDown={onKeyDown}
                 required={Boolean(this.props.required)}
                 valueLink={this.props.value}
                 name={this.props.name}
                 id={this.props.id} />

          <div className="datetime">
            {picker}
          </div>

          <div className="input-group-btn">
            <button className="btn btn-default" tabIndex="-1"
                    onClick={this.handleShowPicker}>
              <i className="glyphicon glyphicon-calendar" />
            </button>
          </div>
        </div>
      </div>
    );
  }
});

var PriceField = React.createClass({
  displayName: 'PriceField',

  render: function() {
    var range = _.pick(this.props, ['min', 'max', 'step']);
    range.min = range.min || 0;

    var events = _.pick(this.props, 'onBlur onFocus onChange'.split(' '));

    return (
      <div className="form-group">
        <label htmlFor={this.props.id}>
          {this.props.title}
        </label>

        <div className="input-group">
          <div className="input-group-addon">
            <i className="glyphicon glyphicon-usd" />
          </div>

          <input type="number" className="form-control" {...events}
                 onKeyDown={onKeyDown}
                 required={Boolean(this.props.required)}
                 defaultValue={this.props.defaultValue}
                 valueLink={this.props.value} {...range}
                 name={this.props.name}
                 id={this.props.id} />

        </div>
      </div>
    );
  }
});

module.exports = {
  PaxField: PaxField,
  PriceField: PriceField,
  DateTimeField: DateTimeField,
  TextField: TextField,
  TextArea: TextArea,
  NumberField: NumberField,
  SelectField: SelectField,
  StaticField: StaticField
}

var React = require('react');
var ReactDOM = require('react-dom');

var components = require('components');
var lib = require('../../lib');


var $editTrip = $('.edit-trip'),
    $tripModal = $('#edit-trip-modal'),
    $tripMount = $tripModal.find('.react-mount');

$editTrip.on('click', function (ev) {
  ev.preventDefault();

  var $this = $(this),
      action = $this.data('action'),
      trip = $this.data('trip') || {};

  ReactDOM.render(
      React.createElement(
          components.Trips.QuickForm,
          {action: action, trip: trip}
      ),
      $tripMount.get(0),
      function() { $tripModal.modal('show') }
  );
});

$tripModal.on('shown.bs.modal', function () {
  lib.selectFormInput($tripMount.find('form'));
});

var _ = require('lodash');
var Forms = require('./forms');
var React = require('react');

var moment = require('moment');

var LinkedStateMixin = require('react-addons-linked-state-mixin');

if (typeof window.COMPANIES === 'undefined') window.COMPANIES = [];

var toOption = function(c) { return { value: c.company.id, title: c.company.name } },
    forKind = function(kind) { return function(c) { return c.company.kind === kind } },
    HOTELS = COMPANIES.filter(forKind('hotel')).map(toOption),
    TOURS = COMPANIES.filter(forKind('tour')).map(toOption),
    TRANSPORTS = COMPANIES.filter(forKind('transport')).map(toOption);

var Form = React.createClass({
  displayName: 'Form',
  mixins: [LinkedStateMixin],

  getInitialState: function(props) {
    props = props || this.props;

    var res = props.reservation,
        defaults = res ? res.reservation : props.defaults || {},
        departure, arrival;

    departure = _.compact([defaults.departure, defaults.departure_time]).join(' ');
    arrival = _.compact([defaults.arrival, defaults.arrival_time]).join(' ');

    return _.assign({
      arrival_date_time: arrival,
      departure_date_time: departure,
      dropoff_location: defaults.dropoff_location,
      pickup_location: defaults.pickup_location
    }, defaults);
  },

  componentWillReceiveProps: function(props) {
    this.setState(this.getInitialState(props));
  },

  setDefaultRackPrice: function(ev) {
    var value = Number(ev.target.value);

    if (! this.state.price && value) {
      this.setState({price: value})
    }
  },

  render: function() {
    var hiddenId, method = this.props.method,
        companies, kind;

    if (this.state.id) {
      hiddenId = (
        <input type="hidden" name="reservation[id]" value={this.state.id} />
      );
    }

    if (! method) method = this.state.id ? 'put' : 'post';

    kind = this.props.kind[0].toUpperCase() + this.props.kind.substr(1);

    switch (this.props.kind) {
      case 'hotel':     companies = HOTELS; break;
      case 'tour':      companies = TOURS; break;
      case 'transport': companies = TRANSPORTS; kind = 'Operator'; break;
    }

    return (
      <div className="row">
        <form className="form" method="post" action={this.props.action}>
          <input type="hidden" name="_method" value={method} />
          {hiddenId}

          <div className="col-xs-12 col-sm-3">
            <Forms.PaxField id="reservation-num_people" name="reservation[num_people]"
                            title="Pax" required={true}
                            value={this.linkState('num_people')} />
          </div>

          <div className="col-xs-12 col-sm-6">
            <Forms.TextField id="reservation-services" name="reservation[services]"
                             title="Services" value={this.linkState('services')} />
          </div>

          <div className="col-xs-12 col-sm-3">
            <Forms.SelectField id="reservation-company_id" name="reservation[company_id]"
                              title={kind} prompt="Select a Company" required={true}
                              value={this.linkState('company_id')} options={companies} />
          </div>

          <div className="col-xs-6 col-sm-3">
            <Forms.PriceField id="reservation-net_price" name="reservation[net_price]"
                              title="Net Price"
                              onBlur={this.setDefaultRackPrice}
                              value={this.linkState('net_price')}
                              required={true} min={0} step={0.01} />
          </div>

          <div className="col-xs-6 col-sm-3">
            <Forms.PriceField id="reservation-price" name="reservation[price]"
                              title="Rack Price"
                              value={this.linkState('price')}
                              required={true} min={0} step={0.01} />
          </div>

          <div className="col-xs-6 col-sm-3">
            <Forms.DateTimeField id="reservation-arrival_date_time" name="reservation[arrival_date_time]"
                                 title="Arrival"
                                 value={this.linkState('arrival_date_time')}
                                 required={true} />
          </div>

          <div className="col-xs-6 col-sm-3">
            <Forms.DateTimeField id="reservation-departure_date_time" name="reservation[departure_date_time]"
                                 title="Departure"
                                 value={this.linkState('departure_date_time')}
                                 required={true} />
          </div>

          <div className="col-xs-6">
            <Forms.TextField id="reservation-pickup" name="reservation[pickup_location]"
                             title="Pick Up Location"
                             value={this.linkState('pickup_location')} />
          </div>

          <div className="col-xs-6">
            <Forms.TextField id="reservation-dropoff" name="reservation[dropoff_location]"
                             title="Drop Off Location"
                             value={this.linkState('dropoff_location')} />
          </div>

          <div className="col-xs-12 text-right">
            <button className="btn btn-primary" type="submit">
              <i className="glyphicon glyphicon-ok" />
              &nbsp; Save
            </button>
          </div>
        </form>
      </div>
    );
  }
});

var RackPrice = React.createClass({
  displayName: 'RackPrice',
  mixins: [LinkedStateMixin],

  getInitialState: function(props) {
    props = props || this.props;

    return _.assign({}, props);
  },

  componentWillReceiveProps: function(props) {
    this.setState(this.getInitialState(props));
  },

  render: function() {
    return (
        <form className="form" action={this.props.action} method="post">
          <input type="hidden" name="_method" value="put" />

          <div className="row">
            <div className="col-xs-12 col-sm-6">
              <Forms.StaticField title="Company" value={this.state.company} />
            </div>

            <div className="col-xs-12 col-sm-6">
              <Forms.StaticField title="Services" value={this.state.services} />
            </div>
          </div>

          <div className="row">
            <div className="col-xs-6">
              <Forms.StaticField title="Net Price" value={this.state.netPrice} />
            </div>

            <div className="col-xs-6">
              <Forms.PriceField value={this.linkState('rackPrice')}
                                id="reservation-price"
                                name="reservation[price]"
                                required={true}
                                title="Rack Price" />
            </div>
          </div>

          <div className="row">
            <div className="col-xs-12">
              <Forms.TextArea value={this.linkState('notes')}
                              id="reservation-notes"
                              name="reservation[notes]"
                              title="Private Notes" />
            </div>
          </div>


          <div className="row">
            <div className="col-xs-12 text-right">
              <button type="submit" className="btn btn-primary">
                <i className="glyphicon glyphicon-ok" />
                &nbsp; Save
              </button>
            </div>
          </div>
        </form>
    );
  }
});


var Confirmation = React.createClass({
  displayName: 'Confirmation',
  mixins: [LinkedStateMixin],

  getInitialState: function (props) {
    props = props || this.props;

    return _.assign({}, props);
  },

  componentWillReceiveProps: function (props) {
    this.setState(this.getInitialState(props));
  },

  render: function() {
    return (
        <form className="form" action={this.props.action} method="post">
          <input type="hidden" name="_method" value="put" />
          <input type="hidden" name="reservation[confirmed]" value="true"/>

          <div className="row">
            <div className="col-xs-6">
              <Forms.StaticField title="Company" value={this.state.company} />
            </div>

            <div className="col-xs-6">
              <Forms.StaticField title="Services" value={this.state.services} />
            </div>

            <div className="col-xs-12">
